import React from 'react';
import './App.css';
import ReactDOM from 'react-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to counter app</h1>
        <button onClick={plus}>+</button>
        <button onClick={reset}>reset</button>
        <button  onClick={minus}>-</button>
      </header>
    </div>
  );
}

function plus() {
  alert("+");
}

function minus() {
  alert("-");
}
function reset() {
  alert("reset");
}

export default App;
